import React from "react";
import Axios from "axios";

export default function EmployeInfoCall() {
  const [data, setData] = useState(null);

  useEffect(() => {
    Axios.get("https://randomuser.me/api/?results=50").then(res =>
      setData(res.data)
    );
  }, []);

  return (
    <div>
      {JSON.stringify(data)}
      {data && <img src={data.message} />}
    </div>
  );
}
